import React from 'react';

function Home() {
    return (
        <div style={{ textAlign: 'center', marginTop: '100px' }}>
            <div style={{ display: 'inline-block' }}>
                <div
                    style={{
                        width: '150px',
                        height: '150px',
                        backgroundColor: '#4CAF50',
                        margin: '10px',
                        display: 'inline-block',
                        cursor: 'pointer',
                    }}
                >
                    Kafelek 1
                </div>
                <div
                    style={{
                        width: '150px',
                        height: '150px',
                        backgroundColor: '#2196F3',
                        margin: '10px',
                        display: 'inline-block',
                        cursor: 'pointer',
                    }}
                >
                    Kafelek 2
                </div>
            </div>
        </div>
    );
}

export default Home;
